const Profile = () => {
  return (
    <div className="container mx-auto mt-8">
      <h1 className="text-3xl font-bold text-center">Your Profile</h1>
      <p className="text-center mt-4 text-gray-700">
        Manage your account information here.
      </p>
    </div>
  );
};

export default Profile;
